         QScriptValue REcmaImageEntity::toString
    (QScriptContext *context, QScriptEngine *engine)
    
    {

    RImageEntity* self = getSelf("toString", context);
    
    QString result;
    
            result = QString("RImageEntity(0x%1)").arg((unsigned long int)self, 0, 16);
        
    return QScriptValue(result);
    }
     QScriptValue REcmaImageEntity::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RImageEntity* self = getSelf("RImageEntity", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RImageEntity* REcmaImageEntity::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RImageEntity* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RImageEntity >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RImageEntity.%1(): "
                        "This object is not a RImageEntity").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RImageEntity* REcmaImageEntity::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RImageEntity* selfBase = getSelf(fName, context);
                RImageEntity* self = dynamic_cast<RImageEntity*>(selfBase);
                //return REcmaHelper::scriptValueTo<RImageEntity >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RImageEntity.%1(): "
                    "This object is not a RImageEntity").arg(fName),
                    context);
            }

            return self;
            


        }
        